import { Paper } from "@mui/material";
import { Alert, Col, Container, Row } from "react-bootstrap";

export function AddStudent()
{
    return(
        <>
          <div className="mt-5">
              <Container>
                  
                  <Row>
                    <Col lg={3}></Col>
                    <Col lg={6}>
                    <Paper className="p-3">
                    <Alert className="text-center"><h3>Register Student</h3></Alert>

                    </Paper>
                    </Col>
                    <Col lg={3}></Col>

                  </Row>
              </Container>
          </div>
        
        </>
    )
}
